$_MODULE['<{wkwebp}prestashop>adminwebpconfigurationcontroller_60d3d1a8cf7e9a1350ff3c24f3389e69'] = 'بيانات التعريف هي معلومات حول الصورة المحولة التي سيتم تضمينها في ملف الصورة المحول ، وهي تتضمن تفاصيل ذات صلة بالصورة نفسها بالإضافة إلى معلومات حول إنتاجها. لن يوصى بأي منها لأن cwebp فقط يدعم جميع القيم. ستزيل gd دائمًا جميع البيانات الوصفية. يمكن للباقي إما تجريد الكل أو الاحتفاظ به.';
