$_MODULE['<{wkwebp}prestashop>adminwebpconfigurationcontroller_e066895e5b691d32d2bf176de9fdbb3e'] = 'EWWW صورة محسن هو خدمة سحابة رخيصة جدا لتحسين الصور. بعد شراء مفتاح API، إضافة المحول في خيار محولات إضافية، مع مجموعة مفتاح المفتاح. والمعهد EWWW لا يدعم الخيار ضياع، ولكنه تلقائيا تحويل PNG losslessly. الفوقية إما كل شيء أو لا شيء. إذا قمت بتعيين إلى شيء آخر غير واحد من هذه، سيتم الحفاظ على جميع البيانات الوصفية.';
