$_MODULE['<{wkwebp}prestashop>adminwebpconfigurationcontroller_95c6819c9ef4af963d005ac0da150d25'] = "بدعم من: cwebp ، و Graphicsmagick ، \u{200b}\u{200b}و imagemagick ، \u{200b}\u{200b}وينطبق هذا الخيار فقط على المحولات التي تستخدم exec () لتنفيذ ثنائي مباشرة على المضيف. إذا تم تعيين use-nice ، فسيتم فحصه إذا كان الأمر nice متاحًا على المضيف. إذا كان الأمر كذلك ، فسيتم تنفيذ الثنائي باستخدام nice. هذا يعين أولوية منخفضة للعملية وسيوفر موارد النظام - ولكن ينتج عنه تحويل أبطأ.";
